import React from 'react';
import images from "../Utilities/ImageDirectories/TeamImageDirectory/Teams.json"
import {useLocation} from 'react-router-dom'

function App() {
    let NewImageArray = []
    let NewImage = {}
    console.log(images.length)
    for(let i = 0 ;i <= images.length;){
      let imageId = images[i].id

      if(imageId.toString().includes("God's Vineyard")){
        NewImage = {url : images[i].url, alt : images[i].alt}
        NewImageArray.push(NewImage)
      }
      console.log(i)
      console.log(imageId)
      i++
    }
    
    
    const location = useLocation()

    const TeamGalleryPath = location.pathname

  return (
    <div className="flex flex-wrap justify-center">
      
      hello
      {NewImageArray.map((image, index) => (
        <img
          key={index}
          src={image.url}
          alt={image.alt}
          className="w-96 h-96 object-cover m-4"
        />
      ))}
    </div>
  );
}

export default App;
